import React from 'react'

import "./projects.css";
import {default as Project} from '../components'

const projects = [
  {
    title: '',
    description: '',
      image: '',
      tags: ['C', 'Sockets', 'File Descriptors', 'Network'],
    source: 'https://google.com',
    visit: 'https://google.com',
    id: 0,
  },
  {
    title: 'Data Visualizer',
    description:'Implemented a python visualizer of a file hierarchy structure using the pygame library and tree data structures. Each rectangle represents a file\'s name, its size in bytes',
    image: '/images/datavisualizerimage.png',
    tags: ['Python', 'Pygame', 'JSON', 'OS library'],
    source: 'https://google.com',
    visit: 'https://google.com',
    id: 1,
  },
  {
    title: 'Othello Board Game',
    description: 'Implemented the “Othello” board game in Java, using object oriented programming practices, as well as the design pattern of Model View Controller',
      image: '/images/othelloboardgameimage.png',
      tags: ['Java', 'Git', 'Documentation'],
    source: 'https://google.com',
    visit: 'https://google.com',
    id: 2,
  },
  {
    title: '',
    description: '',
    image: '',
    tags: [],
    source: 'https://google.com',
    visit: 'https://google.com',
    id: 3,
  },
];

const Projects = () => {
  return (
    <div>
      {projects.map(({ id, image, title, description, tags, source, visit}) => (
        <Project key={id} 
                 image ={image}
                  title={title}
                  description={description}
                  tags={tags}
                  source={source}
                  visit={visit}>
        </Project>
      ))}
      </div>
  )
}

export default Projects
